            asString:
              'Дворец царя Алексея Михайловича (театральная хоромина)- территория историко-культурного объекта города Москвы. \n   Государственную регистрацию заключения брака во Дворце Алексея Михайловича производит Дворец бракосочетания в Коломенском Управления ЗАГС Москвы. \n   Проведение торжественной церемонии бракосочетания на территории усадьбы осуществляется на ПЛАТНОЙ ОСНОВЕ. \n   После подачи заявления о заключении брака Вам в обязательном порядке потребуется заключить договор возмездного оказания услуг с администрацией Московского государственного объединенного художественного историко-архитектурного и природно-ландшафтного музея-заповедника Коломенское-Люблино-Измайлово (далее-МГОМЗ).    По вопросу заключения договора и определения перечня и стоимости услуг по проведению свадебного торжества Вам необходимо обратиться в офис отдела социально-культурных мероприятий МГОМЗ по адресу: г. Москва, проспект Андропова, д. 39, стр. 69 (тел.: +7 (499) 782-88-93, +7 (910) 454-81-76).',
