            asString:
              'Время прибытия на церемонию бракосочетания: время для записи, которое будет Вам предложено на следующем шаге заполнения заявления о заключении брака, является временем прибытия пары с гостями в отдел ЗАГС.\nКоличество гостей: не более 25 человек.\nПарковка: предусмотрена бесплатная парковка.\nОграничения: запрещается приносить в помещение отдела ЗАГС животных, огнеопасные, взрывчатые, ядовитые, пахучие и радиоактивные вещества, пиротехнические устройства, оружие. В помещении и на территории отдела ЗАГС не допускается распитие алкогольных напитков, проведение церемонии "битья бокалов и фужеров на счастье", использование при поздравлении монет, риса, хлопушек, конфетти, лепестков роз и других цветов.',
